import NavItem from "./NavItem";
import React from "react";


export default function Navbar (){
    
    
    let state = React.useState(['HomeState', 'CatalogState', 3, 4]);

    let idk = state[0];
    //na [0] e masiva, a na [1] e funkciq

    console.log(idk);

    return(
        <nav-bar>
            <NavItem href="#" text = 'Home' />
            <NavItem href='#' text = 'Catalog' />
            <NavItem href='#' text = 'About' />
            <NavItem href='#' text = 'Contacts' />
        </nav-bar>
    );
}
